import React from "react";
import { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import signUpValidation from "../validation/SignUpValidation";

const SignUp = () => {
  const [user, setUser] = useState({
    firstname: "",
    lastname: "",
    email: "",
    password: "",
  });

  const navigate = useNavigate();
  const [errors, setErrors] = useState({});
  // let errorMessages = {};

  const handleChange = (e) => {
    setUser((prev) => ({ ...prev, [e.target.name]: e.target.value }));
    // console.log(user);
  };

  const handleSubmit = async (e) => {
    e.preventDefault(); // stops page from refreshing. If page refreshes, the inputted data is lost
    // if (!user.firstname || !user.lastname || !user.email || !user.password) {
    //   console.log("Form fields are required");
    //   return;
    // }
    try {
      // console.log(user);
      let errorMessages = signUpValidation(user);
      setErrors(errorMessages);
      console.log(errorMessages);

      if (Object.values(errors).every((error) => !error)) {
        console.log("User values before", user);
        await axios.post("http://localhost:8800/api/v1/register", user);
        setTimeout(() => {
          navigate("/");
        }, 2000);
        // navigate("/");
        // console.log("Test");
      } else {
        console.log("Bad sign up attempt");
      }

      // if (
      //   errors.noUppercaseChar === "" &&
      //   errors.noNumericalChar === "" &&
      //   errors.noSpecialChar === "" &&
      //   errors.isEmptyPass === "" &&
      //   errors.isEmptyEmail === "" &&
      //   errors.improperEmail === "" &&
      //   errors.noFirstName === "" &&
      //   errors.noLastName === ""
      // ) {
      //   await axios.post("http://localhost:8800/api/v1/register", user);
      //   navigate("/");
      //   // console.log("Test");
      // } else {
      //   console.log("Bad sign up attempt");
      // }
    } catch (err) {
      console.log(err);
    }
  };

  return (
    <div className="sign-up">
      <div className="title-container">
        <h1 className="title">Sign Up For Express Tracker</h1>
      </div>

      <div className="form-container">
        <form className="form" onSubmit={handleSubmit}>
          <div>
            <label>First Name</label>
            <div className="fname">
              <input type="text" name="firstname" onChange={handleChange} />
            </div>
          </div>

          <div>
            <label>Last Name</label>
            <div className="lname">
              <input type="text" name="lastname" onChange={handleChange} />
            </div>
          </div>

          <div>
            <label>Email address</label>
            <div className="input-container">
              <input type="text" name="email" onChange={handleChange} />
              {errors.isEmptyEmail && (
                <span className="error-text">{errors.isEmptyEmail}</span>
              )}
            </div>
          </div>

          <div>
            <label>Password</label>
            <div className="input-container">
              <input type="password" name="password" onChange={handleChange} />
            </div>
          </div>

          <div>
            <button className="formButton" type="submit">
              Sign Up
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default SignUp;
